t":"2024-08-04T16:09:58.163Z","cooked":"<p>I’m not an expert in Kotlin, so please forgive me if I’m wrong, but It appears that you initialize all your subsystems and your Auto class inside <code>RobotContainer</code>, but you try to access and call a function from Auto inside <code>Robot</code>, which could lead to the null error you’re getting. Try creating a function inside <code>RobotContainer</code> that returns the auto command, that way you know for sure that all the necessary requirements have been initialized. Here’s an example from our code:</p>
<pre data-code-wrap="java"><code class="lang-java"> public Command getAutonomousCommand() {
        Command command = autoChooser.get();
        if (!command.getName().equals("1Note-Vision")) {
            drive.resetOdometry(PathPlannerAuto.getStaringPoseFromAutoFile(command.getName()));
        }
        return command;
    }
</code></pre>
<p>Which is called in <code>Robot</code>:</p>
<pre data-code-wrap="java"><code class="lang-java">public void autonomousInit() {
        autonomousCommand = robotContainer.getAutonomousCommand();

        // schedule the autonomous command (example)
        if (autonomousCommand != null) {
            autonomousCommand.schedule();
        }
    }
</code></pre>
